import React from "react";
import "./App.css";

function Welcome() {
  return (
    <div>
      <h1>
        <span className="got-font">Game of Thrones</span> <br></br>
        Winter has Cometh ...
      </h1>

      <div className="container">
        <p>
          This application uses data pulled from a <bold>Game of Thrones API</bold> to allow <br></br>
          users search for a GOT character by their first name, and build a <br></br>
          doughnut chart displaying the number of people in each House.
        </p>
      </div>

      <h2>Data provided from</h2>
      <a href="https://thronesapi.com/api/v2/Characters">
        https://thronesapi.com/api/v2/Characters
      </a>
    </div>
  );
}

export default Welcome;
